import "styles/AutocompleteItem.global.scss";

const AutocompleteItem: React.FC<{ searchCache: string[]; search: string }> = ({
  searchCache,
  search,
}) => {
  console.log(searchCache);
  return (
    <div className="autocomplete__item">
      <div>
        <svg
          height="16"
          width="16"
          aria-label="Search"
          viewBox="0 0 16 16"
          version="1.1"
